(1763, 0, 'USPS Shipping for MyMuse', 'plugin', 'shipping_usps', 'mymuse', 0, 0, 1, 0, '{\"name\":\"USPS Shipping for MyMuse\",\"type\":\"plugin\",\"creationDate\":\"July 16 2018\",\"author\":\"Gord Fisch\",\"copyright\":\"Copyright (C) 2008-2018 Arboreta Internet Services\",\"authorEmail\":\"\",\"authorUrl\":\"http:\\/\\/www.joomlamymuse.com\",\"version\":\"1.0.0\",\"description\":\"\\n    \\t\\n\\t\\t<div style=\'font-weight: normal\' align=\'left\'>\\n\\t\\t\\t<h1>USPS Shipping for MyMuse<\\/h1>\\n\\t\\t\\t<p>The USPS Shipping plugin supports USPS Domestic API v4 and USPS International API v2 using cURL for MyMuse 4 running on Joomla 3.<\\/p>\\n\\t\\t\\t<p><strong style=\'color: #ff0000;\'>Configuration Requirements<\\/strong>\\n\\t\\t\\t<ul>\\n\\t\\t\\t\\t<li><strong style=\\\"color: #ff3300\\\">Configure Plugin Settings<\\/strong>\\n\\t\\t\\t\\t\\t<ul style=\\\"list-style: disc\\\">\\n\\t\\t\\t\\t\\t\\t<li>Enable the USPS Shipping Plugin from Joomla!\'s plugin extension list.<\\/li>\\n\\t\\t\\t\\t\\t\\t<li>Add the USPS Username provided to you by USPS.<\\/li>\\n\\t\\t\\t\\t\\t\\t<li>Request USPS to move your API username to production. This MUST be completed by USPS.<\\/li>\\n\\t\\t\\t\\t\\t\\t<li>If your web server requires the use of a proxy server enter it into the settings.<\\/li>\\n\\t\\t\\t\\t\\t<\\/ul>\\n\\t\\t\\t\\t<\\/li>\\n\\t\\t\\t\\t<li><strong style=\\\"color: #ff3300\\\">Configure MyMuse for USPS Shipping<\\/strong>\\n\\t\\t\\t\\t\\t<ul style=\\\"list-style: disc\\\">\\n\\t\\t\\t\\t\\t\\t<li>Add each USPS Shipping Service your store will use (both domestic and international).<\\/li>\\n\\t\\t\\t\\t\\t\\t<li>Ensure the shop\'s Bill To Zip\\/Postal Code is entered under Shop Settings.<\\/li>\\n\\t\\t\\t\\t\\t\\t<li>Add proper weight to each of your products that will require shipping costs.<\\/li>\\n\\t\\t\\t\\t\\t<\\/ul>\\n\\t\\t\\t\\t<\\/li>\\n\\t\\t\\t<\\/ul>\\n\\t\\t\\t<\\/p>\\n\\t\\t\\t<p>Copyright 2018 <a href=\'http:\\/\\/www.joomlamymuse.com\\/\' title=\'Arboreta Internet Services.\'>Arboreta Internet Services<\\/a>.<\\/p>\\n\\t\\t\\t<p>Based on USPS Shipping for Virtuemart<br \\/>\\n\\t\\t\\tCopyright 2013-2018 <a href=\'http:\\/\\/www.parkbeachsystems.com\\/\' title=\'Park Beach Systems, Inc.\'>Park Beach Systems, Inc<\\/a>.<\\/p>\\n\\t\\t<\\/div>\\n\\t\\t\\n\\t\",\"group\":\"\",\"filename\":\"shipping_usps\"}', '{\"USPS_USERNAME\":\"\",\"USPS_SERVER\":\"PRODUCTION\",\"USPS_PROXYSERVER\":\"\",\"USPS_PACKAGESIZE\":\"REGULAR\",\"USPS_PADDING\":\"0%\",\"USPS_MACHINABLE\":\"0\",\"USPS_SMART_FLATRATE\":\"0\",\"ALLOW_MULTI_BOX\":\"0\",\"USPS_RATE_TYPE\":\"RETAIL\",\"USPS_REPORTERRORS\":\"1\",\"debug\":\"0\",\"published_1\":\"0\",\"USPS_HANDLINGFEE_TYPE_1\":\"NONE\",\"USPS_HANDLINGFEE_1\":\"0\",\"countries_1\":\"\",\"zip_start_1\":\"\",\"zip_stop_1\":\"\",\"orderamount_start_1\":\"\",\"orderamount_stop_1\":\"\",\"categories_1\":\"\",\"blocking_categories_1\":\"\",\"maximum_boxes_1\":\"0\",\"published_2\":\"0\",\"USPS_HANDLINGFEE_TYPE_2\":\"NONE\",\"USPS_HANDLINGFEE_2\":\"0\",\"countries_2\":\"\",\"zip_start_2\":\"\",\"zip_stop_2\":\"\",\"orderamount_start_2\":\"\",\"orderamount_stop_2\":\"\",\"categories_2\":\"\",\"blocking_categories_2\":\"\",\"maximum_boxes_2\":\"0\",\"published_3\":\"0\",\"USPS_HANDLINGFEE_TYPE_3\":\"NONE\",\"USPS_HANDLINGFEE_3\":\"0\",\"countries_3\":\"\",\"zip_start_3\":\"\",\"zip_stop_3\":\"\",\"orderamount_start_3\":\"\",\"orderamount_stop_3\":\"\",\"categories_3\":\"\",\"blocking_categories_3\":\"\",\"maximum_boxes_3\":\"0\",\"published_4\":\"0\",\"USPS_HANDLINGFEE_TYPE_4\":\"NONE\",\"USPS_HANDLINGFEE_4\":\"0\",\"countries_4\":\"\",\"zip_start_4\":\"\",\"zip_stop_4\":\"\",\"orderamount_start_4\":\"\",\"orderamount_stop_4\":\"\",\"categories_4\":\"\",\"blocking_categories_4\":\"\",\"maximum_boxes_4\":\"0\"}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
